Keep your memories in this set of lovely boxes.

This is a set of 2 storage boxes.  The larger box closes with a magnetic clasp and is decorated with a black ribbon.  Printed on the lid is:  Life is Breathtakingly Beautiful, Live, Love.
The smaller box also closes with a magnetic clasp.  Printed on it&#39;s lid and one of the side is:  Enjoy Life&#39;s Most Special Moments.  On the front side is:  Laugh.  

These beautiful boxes would look great in a Shabby Chic or Victorian decor.  They would be the perfect place to store precious momentos, such  as wedding memories, baby&#39;s memories (first tooth, first haircut, spoons, shoes), or treasured photos and trinkets.

They would also be a very nice gift for a mother or a bride -to-be.

Both boxes are in very good condition.  They are very clean and free of any condition flaws.

