Our framed burlap prints make wonderful gifts for family and friends for any occasion! Unique and neutral to go with nearly any decor. 

Frame and Mat ARE included! Easel is NOT included.

ITEM INFO:
~Printed with black ink onto real burlap
~Print measurements are 8.5&quot; x 11&quot;
~Print comes matted and mounted into frame
~Mat is included and is an off white in color
~Outside frame measurements are 14&quot; x 17&quot;
~Frame opening is 8&quot;x10&quot;
~Glass is included to cover the print however if you would like to show off the beautiful texture of the burlap you may choose to remove the glass.
~Comes with a sawtooth hanger installed so that it is ready to hang when you receive it.
